import React from "react";

class ParkInfo extends React.Component {
  render() {
    return (
      <div>
      {this.props.name}
      {this.props.fullName}
      {this.props.designation}
      {this.props.weatherInfo}
      {this.props.latLong}
      {this.props.description}
      </div>
    );
  }
}

export default ParkInfo;
